import React from 'react';
import './CourseTestimonial.css'
import axios from 'axios'

const CourseTestimonial = (props) => {
    console.log(props.AccData)
    return (
        <div className='Testimonial-container'>
        <div className='Testmonial'>
            {/* <img className='Client__Image' src={require('./img/client.png')} alt='Client'/> */}
            <span className='Client__Name' >{props.AccData.Name}</span>
    <span className='Client__Company' >{props.A}</span>
            <p className='Client__Comment'>Мы сопровождаем полный цикл работы веб сайта – от создания самого проекта, вплоть до поисковой оптимизации и проведения рекламной кампании в Интернете.</p>
        </div>
    </div>
    );
};

export default CourseTestimonial;
